// import { useState, useEffect } from 'react';
import React from 'react';
import { Container, Row, Col } from 'styled-bootstrap-grid';
import styled from 'styled-components';

import Banner from '../../containers/Banner';
import TripSection from '../../containers/TripSection';
import ProvinceSection from '../../containers/ProvinceSection';
import { spacing, Section } from '../../theme';

const BGFooter = styled.div`
  padding: 0 40px 0 70px;
  margin-top: 20px;
  background-image: url('https://via.placeholder.com/1200x450');
  min-height: 300px;
  position: relative;
  border-radius: 5px;
  text-align: left;
  display: flex;
  align-items: center;
`;

const Homepage = () => (
  <div>
    <Banner />
    <ProvinceSection />
    <TripSection />

    <Section spacing={spacing.medium}>
      <Container>
        <Row>
          <Col col={12}>
            <BGFooter><h2>สร้างเรื่องราวการท่องเที่ยวแบบใหม่ อีกทั้งยังทำเงินให้คุณได้ด้วย</h2></BGFooter>
          </Col>
        </Row>
      </Container>
    </Section>
  </div>
);

export default Homepage;
